import React, { Component } from "react";

class PERSONAS extends Component {
  render() {
    const { array } = this.props;

    return (
      <div className="center">
        {array.map((el) => (
          <div>
            <p>{el.nombre}</p>
          </div>
        ))}
      </div>
    );
  }
}

export default PERSONAS;
